// localStorage에 저장되어 있는 customerInfo 불러오는 페이지
const getStoredUserInfo = () => {
  const storedUserInfo = localStorage.getItem("customerInfo");
  if (storedUserInfo) {
    return JSON.parse(storedUserInfo).value;
  }
  return null;
};

export default getStoredUserInfo;
